import React from "react";
import "./styles.css";

const Cart = ({ cart }) => {
  return (
    <main className="cart">
      <h2>Your Cart</h2>
      {cart.length === 0 ? (
        <p>No items in your cart yet!</p>
      ) : (
        <ul className="cart-list">
          {cart.map((item, index) => (
            <li key={index} className="cart-item">
              <img src={item.image} alt={item.name} className="cart-item-image" />
              <div className="cart-item-details">
                <h3>{item.name}</h3>
                <p>{item.price}</p>
              </div>
            </li>
          ))}
        </ul>
      )}
    </main>
  );
};

export default Cart;
